import React from "react";

import { BrowserRouter, Switch, Route } from "react-router-dom";

// components
import Listsalon from "./listofsalons/listsalons";
import Navbarclient from "./Menu/menuclient";
import Footer from "../footer/footer";
function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/client/">
          <Navbarclient />
          <Listsalon />
        </Route>
        <Route path="./meetings"></Route>
      </Switch>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
